export default class Clock extends React.Component {
	constructor(props) {
		super(props);
		this.state = { first_name: '', last_name: '', email_address: '', phone_number: '', company_name: '' };
	}
	handleChange(event) {
		this.setState({ title: event.target.value });
	}
	render() {
		return <input type="text" name="first_name" value={this.state.title} onChange={this.handleChange.bind(this)} />;
	}
}
